import{_ as e,c as t,o as a,a4 as r}from"./chunks/framework.DkZrsx35.js";const o="/web/assets/image-9.BnIiO3p7.png",i="/web/assets/image-10.DoDFDB7x.png",l="/web/assets/20240922_224747_image.AWCkd7Fy.png",d="/web/assets/image-11.Bc8bOnrb.png",k=JSON.parse('{"title":"Performance 性能监控工具","description":"","frontmatter":{},"headers":[],"relativePath":"devtools/performance.md","filePath":"devtools/performance.md"}'),s={name:"devtools/performance.md"},n=r('<h1 id="performance-性能监控工具" tabindex="-1">Performance 性能监控工具 <a class="header-anchor" href="#performance-性能监控工具" aria-label="Permalink to &quot;Performance 性能监控工具&quot;">​</a></h1><h2 id="工具栏" tabindex="-1">工具栏 <a class="header-anchor" href="#工具栏" aria-label="Permalink to &quot;工具栏&quot;">​</a></h2><p><img src="'+o+'" alt="alt text"></p><p>从左到右依次为：</p><ul><li>Record(Ctrl+E) 记录运行时性能</li><li>Start profiling and reload page(Ctrl+Shift+E) 记录负载性能，会重新加载页面</li><li>clear 清空面板</li><li>Load profile... 上传</li><li>Save profile... 下载，会生成个json文件，需要做比对可以再上传</li><li>recordings 生成过的profile列表记录，注意：点clear就全没有了</li><li>Screenshots 屏幕截图，启用会在录制时捕获每一帧的屏幕截图</li><li>Memory 内存</li><li>Web Vitals 核心功能，会显示LCP，FCP，LongTasks</li><li>Collect garbage 录制时强制垃圾收集</li></ul><h2 id="概览" tabindex="-1">概览 <a class="header-anchor" href="#概览" aria-label="Permalink to &quot;概览&quot;">​</a></h2><p><img src="'+i+'" alt="alt text"></p><p>CPU颜色划分： Loading</p><table><thead><tr><th>颜色</th><th>执行内容</th></tr></thead><tbody><tr><td>蓝色 (<em>Loading</em> )</td><td>网络通信和HTML解析</td></tr><tr><td>黄色 (<em>Scripting</em> )</td><td>JavaScript执行</td></tr><tr><td>紫色(<em>Rendering</em> )</td><td>样式计算和布局(重排)</td></tr><tr><td>绿色 ( *Painting * )</td><td>样式更改(重绘)</td></tr><tr><td>灰色 (<em>Other</em> )</td><td>其他事件</td></tr><tr><td>白色 ( *Idle * )</td><td>空闲时间</td></tr><tr><td>红色 (<em>LongTasks</em> )</td><td>长任务出现</td></tr></tbody></table><h2 id="火焰图" tabindex="-1">火焰图 <a class="header-anchor" href="#火焰图" aria-label="Permalink to &quot;火焰图&quot;">​</a></h2><h3 id="frames-帧" tabindex="-1">Frames-帧 <a class="header-anchor" href="#frames-帧" aria-label="Permalink to &quot;Frames-帧&quot;">​</a></h3><p><img src="'+l+'" alt=""></p><ul><li>白色：没有变化</li><li>绿色：按预期及时渲染</li><li>黄色：浏览器尽最大努力及时呈现至少一些视觉更新，比如滚动了但主线程没空</li><li>红色：掉帧，无法在合理的时间内渲染帧，比如：<code>scroll</code>，<code>resize</code>事件触发过于频繁,浏览器来不及处理导致在下一个事件被触发之前无法完成</li></ul><h3 id="main-主线程" tabindex="-1">Main-主线程 <a class="header-anchor" href="#main-主线程" aria-label="Permalink to &quot;Main-主线程&quot;">​</a></h3><p><img src="'+d+'" alt="alt text"></p><blockquote><p><code>Ctrl + F</code>可以搜索<code>Task</code>名字，定位到具体的位置会标红</p></blockquote><p>右上角有红色三角形表示该Task是一个长任务(执行超过50ms)，左边灰色区域执行时间50ms，右边红色区域执行时间就是39.83ms。长任务过多会导致页面出现卡顿。</p><h4 id="task-颜色划分" tabindex="-1">Task 颜色划分 <a class="header-anchor" href="#task-颜色划分" aria-label="Permalink to &quot;Task 颜色划分&quot;">​</a></h4>',18),c=[n];function m(h,p,_,f,b,g){return a(),t("div",null,c)}const P=e(s,[["render",m]]);export{k as __pageData,P as default};
